import React from "react";
import { Bar,Pie } from "react-chartjs-2";
import {Chart as ChartJs} from "chart.js/auto"

export default function GraphData({chartData }){
  return(
    <div
      // style={{
      //   display: "flex",
      //   height: "50px",
      //   width: "150",
      //   justifyContent: "center",
      //   alignItems: "center",
      //   flexDirection: "column",
      //   marginTop: "300px",
      // }}
    >

      {/*<Pie data={data} options={options}/>*/}

      <Bar
        data={{
          labels: [
            "Africa",
            "Asia",
            "Europe",
            "Latin America",
            "North America"
          ],
          datasets: [
            {
              label: "Population (millions)",
              backgroundColor: [
                "#3e95cd",
                "#8e5ea2",
                "#3cba9f",
                "#e8c3b9",
                "#c45850"
              ],
              data: [2478, 5267, 734, 784, 433]
            }
          ]
        }}
        options={{
          legend: {
            display: true,
            position: 'right',
            labels: {
              fontColor: '#000'
            },
          },
          title: {
            display: true,
            text: "Predicted world population (millions) in 2050"
          }
        }}
      />


    </div>
  )
}
